import React from "react";
const Laporan = () => (
  <div>
    <p>
      Dengan menggunakan resto apps ini memudahkan dalam membantu pekerjaan
      untuk mempercepat transaksi sekaligus mencatat pembukuan secara detail dan
      akurat , gunakan dexopos apps untuk masa depan terbaik untuk bisnis
      restoran cafe rumah makan dan kuliner mu.
    </p>
  </div>
);

export default Laporan;
